import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 64.2-119 Terms-of-service agreement.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-119.md","filePath":"vacode/64.2-119.md"}'),i={name:"vacode/64.2-119.md"},s=t('<h1 id="§-64-2-119-terms-of-service-agreement" tabindex="-1">§ 64.2-119 Terms-of-service agreement. <a class="header-anchor" href="#§-64-2-119-terms-of-service-agreement" aria-label="Permalink to &quot;§ 64.2-119 Terms-of-service agreement.&quot;">​</a></h1><p>A. This article does not change or impair a right of a custodian or a user under a terms-of-service agreement to access and use digital assets of the user.</p><p>B. This article does not give a fiduciary or a designated recipient any new or expanded rights other than those held by the user for whom, or for whose estate, the fiduciary or designated recipient acts or represents.</p><p>C. A fiduciary&#39;s or designated recipient&#39;s access to digital assets may be modified or eliminated by a user, by federal law, or by a terms-of-service agreement if the user has not provided direction under § <a href="http://law.lis.virginia.gov/vacode/64.2-118/" target="_blank" rel="noreferrer">64.2-118</a>.</p><p>2017, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0033" target="_blank" rel="noreferrer">33</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0080" target="_blank" rel="noreferrer">80</a>.</p>',5),o=[s];function n(c,d,l,f,h,_){return r(),a("div",null,o)}const m=e(i,[["render",n]]);export{g as __pageData,m as default};
